import React from 'react';

import { NavLink } from 'react-router-dom';

const Navigation = () => {
    return (
        <div>
            <NavLink to="/login">Login</NavLink>
            <NavLink to="/signUp">SignUp</NavLink>
        </div>
    );
}

export default Navigation;
